const Book = ({ title, author, publishingHouse, pages }) => {
  return (
    <>
      <li>title: {title}</li>
      <li>author: {author}</li>
      <li>publishing House {publishingHouse}</li>
      <li>pages: {pages}</li>
    </>
  );
};

export default Book;
